          "message": "CN VIP: Add conversion to/from bytes for Blocks\n\nThis commit adds conversion to/from bytes for Blocks. In doing so,\nit restricts the grammar for to_bytes/from_bytes to only accept\npredicates, because we need the C type information when converting\nfrom bytes, and can derive the bytes resource to be requested in the\nsame way as we do for to_bytes.\n\nThis is easy because the hard parts about provenances in bytes and\nconstraining values appropriately only show up with Owned resources.",
