          "id": "c1eb2a1a9a06c42a224553d8f7bf15b619060b45",
          "message": "CN VIP: Update the succ tests to use byte rep conv\n\nBecause of the lack of roundtrip support (not just via u/intptr_t, but\nalso via byte representations) this commit adds a `#ifdef NO_ROUND_TRIP`\nline to many tests to compensate by using a copy_alloc_id (though this\nis possible in these tests, it won't always be possible in general).\n\nAll the added lines are of the form `p = copy_alloc_id((uintptr_t)p, q)`\nwhich means that the prior code must get the address correct for only\nthe allocation ID to be fixed up.\n\nAlso fixes a pointer-to-integer (index term) casting bug and changes the\nbase type to explicitly be unsigned char (char being signed or unsigned\nis implementation-defined, could have just as well picked signed char).",
